script: |
  super -f text -I q5960.spq | sort > q5960.out

inputs:
  - name: q5960.spq
    data: |
      SELECT DISTINCT col2 FROM tab1 (FORMAT parquet) WHERE NOT col1 BETWEEN + 64 * ( - col1 ) * - 19 AND + CAST ( + 48 AS INTEGER ) * + 61 * + CAST ( NULL AS INTEGER ) * - 27;
  - name: tab1

outputs:
  - name: q5960.out
    data: |
      59
      68
      96
